import React, {Component} from 'react';

import {Map, GoogleApiWrapper} from 'google-maps-react';

const mapStyles={
  width:'100%',
  height:'100%'
}

export class MapContainer extends Component{

  render(){
    console.log('here');
    return(
      <Map google ={this.props.google} //map custom tag is taking in pm 
      zoom={14}
      style={mapStyles}
      initialCenter={{
        lat:-1.2884,
        lng: 36.8233
      }}
      /> //end of map tag
    );
  }

}

export default GoogleApiWrapper({
  apiKey:'AIzaSyDokAydr-CwKQJiwc-RaW8rN4o64hkfdrU'
})(MapContainer);
